import { useEffect } from 'react';
import { URL_MOVIES } from './Api';

const App = () => {
  useEffect(()=>{
    fetch(URL_MOVIES).then((response)=>{
      return response.json()
    }).then((data)=>{
      console.log(data)
    })
  },[])

  return(
    <h3>Movies app react</h3>
  )
}

export default App;
